">// build.gradle.kts (Configurer la liaison de données)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le fichier de configuration Gradle application
Gradle Scripts &gt; build.gradle.kts (Module :app)
...
# Configurer la liaison de données
...
android {
    ...
    buildFeatures {
        viewBinding = true
    }
}
...
# Synchroniser un projet avec les fichiers Gradle
...</pre><br><span class="GText2" style="
color: #00ff00;
">// MainActivity.java (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="java" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
public class MainActivity extends AppCompatActivity {
    private ActivityMainBinding binding;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        binding = ActivityMainBinding.inflate(getLayoutInflater());
        setContentView(binding.getRoot());

        binding.btnRun.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                Toast.makeText(getApplicationContext(), "btnRun onClick...", Toast.LENGTH_LONG).show();
            }
        });
    }
}
