color: #00ff00;
">// AndroidManifest.xml (Suppression du toolbar par défaut)</span><br><pre class="GCode1 Code1 AceCode" data-mode="xml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?xml version="1.0" encoding="utf-8"?&gt;
&lt;manifest xmlns:android="http://schemas.android.com/apk/res/android"
    xmlns:tools="http://schemas.android.com/tools"&gt;
    &lt;application
        android:allowBackup="true"
        android:dataExtractionRules="@xml/data_extraction_rules"
        android:fullBackupContent="@xml/backup_rules"
        android:icon="@mipmap/ic_launcher"
        android:label="@string/app_name"
        android:roundIcon="@mipmap/ic_launcher_round"
        android:supportsRtl="true"
        android:theme="@style/Theme.Rdv_android"
        tools:targetApi="31"&gt;
        &lt;activity
            android:name=".MainActivity"
            android:exported="true"
