</h1>
<div class="Section6"><br>Une activité est gérée par un fichier source (écrit en Kotlin ou en Java) et une vue layout (écrit en XML). Le fichier source permet de gérer la dynamique de l'activité alors que la vue layout est destinée à réaliser la mise en page des composants graphiques de l'interface utilisateur de l'activité au sein du projet Android. Une activité (<b>Navigation Drawer Views Activity</b>) contient une vue initialisée dès le départ pour gérer un DrawerLayout afin de facilité la navigation entre les différents contenus du projet Android.
